import { useRef } from "react";
import "./login.css"
import { Link } from "react-router-dom"

export default function Login() {

    const email = useRef();

    const clickHandle=(e)=>{
        e.preventDefault();
    }

    return (
        <>
            <form className="loginContainer" onSubmit={clickHandle}>
                <Link to="/" id="text">Instagram</Link>
                <input className="loginInput" type="email" placeholder="Phone number, username or email adress"/>
                <input className= "loginInput" id="loginInput1" type="password" placeholder="Password" />
                <div className="saveInfo">
                    <input className="loginTxt" type="checkbox"/>  
                    <h5 className="saveTxt">Save Login Info</h5>
                </div>
                <button className="loginBtn">Log in</button>
                <a href="#" className="loginForgot">Forgotten Your Password?</a>
            </form>
        </>
    )
}
